import React, {Component} from 'react';
import './App.css';
import Student from './Student/Student';

class App extends Component {
    render() {
        return (
            <div className="App">
                <h1>Dit is de App Titel</h1>
                <p>en een App paragraaf</p>
                <Student/>
                <Student/>
                <Student/>
            </div>
        );
    }
}

export default App;
